rchResults_Label:p("Ergebnisliste"),flex_arch_007:p("Vorprovenienz"),flex_bibl_004:p("Erschienen in"),flex_mus_200_100_20:p("Typzuweisung (wo)"),Api_Description_Text:p("Was ist eine API? <br /><br />Eine Programmierschnittstelle (englisch application programming interface, API; deutsch Schnittstelle zur Anwendungsprogrammierung) ist ein Programmteil, der von einem Softwaresystem anderen Programmen zur Anbindung an das System zur Verfügung gestellt wird. Im Gegensatz zu einer Binärschnittstelle (ABI) definiert eine Programmierschnittstelle nur die Programmanbindung auf Quelltext-Ebene. Zur Bereitstellung solch einer Schnittstelle gehört meist die detaillierte Dokumentation der Schnittstellen-Funktionen mit ihren Parametern auf Papier oder als elektronisches Dokument.<br /><br />Neben dem Zugriff auf Datenbanken oder Hardware wie Festplatte oder Grafikkarte kann eine Programmierschnittstelle auch das Erstellen von Komponenten der grafischen Benutzeroberfläche ermöglichen oder vereinfachen. Zum Beispiel ermöglicht die Programmierschnittstelle Windows Application Programming Interface des bekannten Computer-Betriebssystems Microsoft Windows, dass externe Firmen überhaupt erst Software für dieses Betriebssystem entwickeln können.<br /><br />Heutzutage stellen auch viele Internetdienste Programmierschnittstellen zur Verfügung. Im weiteren Sinne wird die Schnittstelle jeder Bibliothek (Library) als Programmierschnittstelle bezeichnet.<br /><br />Zu unterscheiden ist diese Art funktionaler 'Programmierschnittstellen' von den vielen anderen Schnittstellen, die in der Programmierung angewendet werden \u2013 zum Beispiel die Parameter, die beim Aufruf von Unterprogrammen vereinbart und übergeben werden."),flex_arch_008:p("Laufzeit"),flex_bibl_005:p("Ausgabe"),flex_arch_005:p("Alt-/Vorsignatur"),flex_bibl_002:p("Beteiligte Personen und Organisationen"),Run:p("Ausführen"),flex_arch_006:p("Provenienz"),language_fct_nep:p("Nepali"),flex_bibl_003:p("Dokumenttyp"),Facet_Tooltip_Erze